import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import {HeaderPag, FooterPag, NavMenu} from "../layout/index";
import Views from '../views';

const Home = Views.Home();

function RoutesPag(){
    return(
        <React.StrictMode>
            <HeaderPag/>
            <main>
                <NavMenu/>
                <BrowserRouter>
                    <Routes>
                        <Route path="/" element={Home}/>
                    </Routes>
                </BrowserRouter>
            </main>
            <FooterPag/>

        </React.StrictMode>
    );
};


export default function Pagina(){}
